import React, { Component } from 'react';
import Form from './Form';
import Result from './Result';
import './App.css';

class App extends Component {

  state = {
    value: ""
    }

    render() {
      return (
        <div className="App">
          <Form value={this.state.value} />
          <Result />
        </div>
      );
    }
}

export default App;
